import React from 'react'
import UrlsContextProvider from '../contexts/UrlsContext'

const IndexPage = () => {
  return (
    <div>
      <UrlsContextProvider>
        <h1>Index Page</h1>
      </UrlsContextProvider>
    </div>
  )
}

export default IndexPage
